$\textbf{Os Antigos Territórios de Juan}$

Juan organiza os selos de sua coleção por país e pela década em que foram emitidos. Os preços que ele pagou por eles em uma loja de selos foram: Brasil e França, $6$ centavos cada, Peru $4$ centavos cada, e Espanha $5$ centavos cada. (Brasil e Peru são países da América do Sul e França e Espanha estão na Europa.) [asy]
/* AMC8 2002 #8, 9, 10 Problem */
size(3inch, 1.5inch);
for ( int y = 0; y <= 5; ++y )
{

draw((0,y)--(18,y));
}
draw((0,0)--(0,5));
draw((6,0)--(6,5));
draw((9,0)--(9,5));
draw((12,0)--(12,5));
draw((15,0)--(15,5));
draw((18,0)--(18,5));

label(scale(0.8)*"50s", (7.5,4.5));
label(scale(0.8)*"4", (7.5,3.5));
label(scale(0.8)*"8", (7.5,2.5));
label(scale(0.8)*"6", (7.5,1.5));
label(scale(0.8)*"3", (7.5,0.5));

label(scale(0.8)*"60s", (10.5,4.5));
